import React, {useState, useEffect} from "react";
import "./App.css";

function Item({ match }) {
  useEffect(() => {
      fetchItem();
      console.log(match);
  }, []);
  
  const [item1, setItem] = useState({
    item: {}
  });
  
  const fetchItem = async () => {
      const fetchItem = await fetch(
          `https://fortnite-api.theapinetwork.com/item/get?id=${match.params.id}`
          );
      const donnees = await fetchItem.json();
      setItem(donnees);
      console.log(donnees);

  }
  return (
    <div>
      <h1>{item1.data.item.name}</h1>
    </div>
  );
}
export default Item;
